import React from 'react';

const Contact = () => {
  return (
    <section id="contact" className="contact">
      <div className="contact__content">
        <h2>Contact Me</h2>
        <p>Feel free to reach out to me at the following contact points:</p>
        <ul>
          <li>Email: kamesh@example.com</li>
          <li>Phone: +1234567890</li>
        </ul>
      </div>
    </section>
  );
};

export default Contact;
